let url = 'http://localhost:3000/sinistros';

export default function getMethod() {
  return (
    fetch(url)
      .then((response) => response.json())
      .then((date) => date)
  );
}

export function postMethod (object) {
  fetch(url, {
      method: "POST",
      headers: {
          "Content-type": "application/json; charset=UTF-8"
      },
      body: JSON.stringify({
        "fullName": object.fullName,
        "cpf": object.cpf,
        "plate": object.plate,
        "telephone": object.telephone,
        "email": object.email,
        "accident": object.accident,
        "date": object.date,
        "value": object.value,
        "request": object.request
      })
  })
      .then(response => response.json())
      .then(data => {console.log(data)})
}
